import React from "react";
import "../Styles/Payment.css"
import "../Styles/Main.css"
import Pizza from "../Data/Pizza";
import { Link } from "react-router-dom";

export function PaymentHeader(){
 
    return(
        <div class="hearder">
        <h1>      
        
         Payment
        </h1>
      </div> 
    );
}

export function PayAccountUser(){
    return(
      <div class="left">
        <div class="fill-infor">
          <h1 class="title">FILL YOUR INFORMATION</h1>
          <form class="payment-form">
            <input type="text" id="name" name="name" placeholder="Name" /><br />
            <input type="text" id="phonenumber" name="phonenumber" placeholder="Phone Number" /><br />
            <input type="text" name="address" id="address" placeholder="Address" /><br />
          </form>
        </div>
      </div>
    ); 
}
export function PayOrderProcess(){
  return(
    <div class="order-processing">
        <div class="order-title">
          <h1 class="title">ORDER PROCESSING</h1>
          <div class="dropdown">
            <div class="more" onclick="dropdown()">More dishes</div>
            <div id="menu">
              <ul>
              <Link to="/homepage"><li>Add More Pizza</li></Link>  
              </ul>
            </div>
          </div>
        </div>
        <div id="list-order"></div>
      </div>
  ); 
}
export function PayyMenthod(){
  return(
    <div class="payment-methods">
        <h1 class="title">PAYMENT METHODS</h1>
        <div class="methods">
          <div class="methods-detail" onclick="cash()">
            <p>Cash</p>
          </div>
          <div class="methods-detail" onclick="pay()">
            <p>PayPal</p>
          </div> 
           <div class="methods-detail" onclick="mas()">
            <p>Master Card</p>
          </div>
          <div class="methods-detail" onclick="visa()">
            <p>Visa Card</p>
          </div>
        </div>
      </div>
  ); 
}
 export function PayNote(){
    return(
      <div>
        <div class="invoice">
        <h1 class="title">INVOICE</h1>
        <div class="methods">
          <form class="payment-form">
            <div class="note">
              <input type="text" id="note" name="note" placeholder="Do you want to note anything to the restaurant?" />
            </div>
          </form>
          <div id="inHTML"></div>
        </div>
      </div>
      </div>
    );
}
